import { useState } from "react";


function StudentForm(){
    const [id,setId]=useState("")
    const [name,setName]=useState("")
    const [claass,setClaass]=useState("")
    const [mobile,setMobile]=useState("")
    return(
        <div className="container">
            <h2>Add New Student Data</h2>
            <form>
            <div class="mb-3">
    <label  class="form-label">ID</label>
    <input type="text" value={id} onChange={e=>setId(e.target.value)} disabled="disabled" class="form-control" id="exampleInputName" />
     </div>
    <div class="mb-3">
    <label class="form-label">Student Name</label>
    <input type="text" value={name} class="form-control" id="exampleInputEmail1" aria-describedby="emailHelp"/>
     </div>
    <div class="mb-3">
    <label  class="form-label">Class</label>
    <input type="text" value={claass} class="form-control" id="exampleInputPassword1"/>
    </div>
    <div class="mb-3">
    <label  class="form-label">Mobile</label>
    <input type="Number" value={mobile} class="form-control" id="exampleInputPassword1"/>
    </div>
    <button type="submit" class="btn btn-primary">Submit</button>
    </form>
        </div>
    )
}
export default StudentForm;
